public class InnerIdentitySourceIdentitySourceConfigurationFactory(Action<Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration>
{

    internal InnerIdentitySourceCognitoUserPoolConfigurationFactory CognitoUserPoolConfigurationFactory { get; set; }

    internal InnerIdentitySourceOpenIdConnectConfigurationFactory OpenIdConnectConfigurationFactory { get; set; }

    protected override Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration Create()
    {
        var identitySourceConfigurationResult = CreateIdentitySourceConfiguration();
        factoryAction?.Invoke(identitySourceConfigurationResult);

        return identitySourceConfigurationResult;
    }

    private Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration CreateIdentitySourceConfiguration()
    {
        var identitySourceConfigurationResult = new Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration();

        return identitySourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.VerifiedPermissions.IdentitySourceTypes.IdentitySourceConfiguration result)
    {
        base.CreateChildren(result);

        result.CognitoUserPoolConfiguration ??= CognitoUserPoolConfigurationFactory?.Build();
        result.OpenIdConnectConfiguration ??= OpenIdConnectConfigurationFactory?.Build();
    }

} // End Of Class

